import "./css/reset.css";
import "./css/styles.css";
import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from "./Header/Header";
import PaginaInicial from "./PaginaInicial/PaginaInicial";
import SessionsPage from "./SessionsPage/SessionsPage";
import SeatsPage from "./SeatsPage/SeatsPage";
import SuccessPage from "./SuccessPage/SuccessPage";

export default function App() {
    const [reservationData, setReservationData] = useState({
        ids: [],
	    name: "",
	    cpf: "",
        movie: "",
        date: "",
        showtime: ""
    })
    return (
        <BrowserRouter>
            <Header />
            <Routes>
                <Route path="/" element={<PaginaInicial />}>
                </Route>
                <Route path="/filme/:filmId" element={<SessionsPage />}>
                </Route>
                <Route path="/assentos/:assentosId" element={<SeatsPage setReservationData={setReservationData} />}>     
                </Route>
                <Route path="/sucesso" element={<SuccessPage reservationData={reservationData} />}>
                </Route>
            </Routes>
        </BrowserRouter>
    )
}
